{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# This capstone project follows the six stages of data analysis process:\n## 1. Ask\n## 2. Prepare\n## 3. Process\n## 4. Analyze\n## 5. Share\n## 6. Act","metadata":{}},{"cell_type":"markdown","source":"# Introduction\n### Bellabeat is a cutting-edge technology company that specializes in manufacturing innovative and health-focused smart products. While the company has invested heavily in traditional advertising mediums, such as radio, television, and billboards, it recognizes the importance of data-driven decision-making to achieve higher growth. To this end, Bellabeat aims to leverage the expertise of marketing analytics teams to extract valuable insights from the vast amounts of data it has accumulated, enabling the company to make informed decisions that will accelerate its growth trajectory.","metadata":{}},{"cell_type":"markdown","source":"# 1. Ask\n### Business task: \n#### Identify growth opportunities in the smart device industry by analyzing product trends and their effects on consumer behavior, in order to make data-driven business decisions.\n \n### Key stakeholders:\n* **Urška Sršen:** : Bellabeat’s cofounder and Chief Creative Officer \n* **Sando Mur:**  Mathematician and Bellabeat’s cofounder","metadata":{}},{"cell_type":"markdown","source":"# 2. Prepare","metadata":{}},{"cell_type":"markdown","source":"#### The Fitbit dataset can be accessed on Kaggle at https://www.kaggle.com/datasets/arashnic/fitbit. However, it is important to note that the dataset's reliability may be questionable due to its small sample size of only thirty Fitbit users. Thus, the dataset's findings may not be representative of the entire population. Additionally, the dataset's originality may be limited since it was collected through a third-party source, Amazon Mechanical Turk. Despite these limitations, the dataset is still comprehensively designed, containing all the necessary information to answer the business question. Nonetheless, it is important to note that the dataset requires updating, as the latest entry is from December 2020.\n","metadata":{}},{"cell_type":"markdown","source":"# 3. Process\n\n#### R will be used for data cleaning and data analysis. In this section, we will only analyze the daily data from the fitbit dataset","metadata":{}},{"cell_type":"code","source":"library(readr)\nlibrary(lubridate)\nlibrary(dplyr)\nlibrary(ggplot2)\nlibrary(tidyr)\nlibrary(patchwork)","metadata":{"execution":{"iopub.status.busy":"2023-04-28T22:57:27.056422Z","iopub.execute_input":"2023-04-28T22:57:27.059728Z","iopub.status.idle":"2023-04-28T22:57:28.603063Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    date, intersect, setdiff, union\n\n\n\nAttaching package: ‘dplyr’\n\n\nThe following objects are masked from ‘package:stats’:\n\n    filter, lag\n\n\nThe following objects are masked from ‘package:base’:\n\n    intersect, setdiff, setequal, union\n\n\n","output_type":"stream"}]},{"cell_type":"code","source":"Daily_Activity <- readr::read_csv('../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv',show_col_types = FALSE)\nDaily_Calories <- readr::read_csv('../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyCalories_merged.csv',show_col_types = FALSE)\nDaily_Intensities <- readr::read_csv('../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyIntensities_merged.csv',show_col_types = FALSE)\nDaily_Steps <- readr::read_csv('../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailySteps_merged.csv',show_col_types = FALSE)\nHourly_Steps <- readr::read_csv('../input/fitbit/Fitabase Data 4.12.16-5.12.16/hourlySteps_merged.csv',show