ct(date_time,format =\"%m/%d/%Y %I:%M:%S %p\" , tz=Sys.timezone())) %>%\n  separate(date_time, into = c(\"Date\", \"Time\"), sep= \" \") %>%\n  mutate(Date = ymd(Date)) \n\nHourly_Steps <- Hourly_Steps %>% \n        rename(\"TotalSteps\" = \"StepTotal\")","metadata":{"execution":{"iopub.status.busy":"2023-04-28T22:57:30.419034Z","iopub.execute_input":"2023-04-28T22:57:30.421337Z","iopub.status.idle":"2023-04-28T22:57:31.307568Z"},"trusted":true},"execution_count":17,"outputs":[]},{"cell_type":"markdown","source":"# 4. Analize","metadata":{}},{"cell_type":"code","source":"# Histogram total distance per user\nmean_dist <- Daily_Activity %>% group_by(Id) %>% \nsummarise_at(vars(TotalDistance), list(total_distance = mean)) %>% pull(total_distance) %>% mean()\ntrunc_mean_dist <- trunc(mean_dist*100)/100\n\n\navg_total_distance <- Daily_Activity %>%\n    group_by(Id) %>%\n    summarise_at(vars(TotalDistance), list(total_distance = mean)) %>%\n    ggplot(aes(x=total_distance)) + \n    geom_histogram(bins=6, fill = \"deepskyblue2\",, color=\"deepskyblue2\", alpha=0.2) +\n    geom_vline(aes(xintercept = mean_dist, col=\"red\", , lwd = 1)) +\n    labs(x = \"Total Distance\", y = \"Count\", fill = \"Type\", title = \"Average total distance\") +\n    geom_text(aes(x = mean_dist * 1.7, y = mean_dist * 2 , label = trunc_mean_dist), \n                  size = 10, color = \"black\") + \n    theme(text = element_text(size = 20), legend.position = \"none\")\navg_total_distance","metadata":{"execution":{"iopub.status.busy":"2023-04-29T01:17:29.309047Z","iopub.execute_input":"2023-04-29T01:17:29.315412Z","iopub.status.idle":"2023-04-29T01:17:29.932119Z"},"trusted":true},"execution_count":133,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAAPACAIAAAC9963GAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXxcVeE34DMzSZo03dskLaVA2bdKBaGCbAKCbL4igrIr+lNRZFWQTUTZZVER\nFAUUcGPf90V2KDtUCoVCC22hSUr3ptlm5v1j0mn2dZLclOf5g8+dueeec+7NbZj55px7Yul0\nOgAAAAAA0RDv7w4